''' This Script runs a GUI-based tool for managing self-signed certificates on a Windows machine.
    It primarily offers functions such as listing, searching and removing certificates and additionally self-signing executable files with certificates.
    '''

# created:      Payam Avarwand - 21.04.2025
# last change:  Payam Avarwand - 27.04.2025

############ Allow the execution Policy ###########

# Check and temporarily set execution policy to Bypass for this session
if ((Get-ExecutionPolicy) -ne 'Bypass') {
    Set-ExecutionPolicy -Scope Process -ExecutionPolicy Bypass -Force
}

###################################################

Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing

# Ensure C:\temp exists
if (-not (Test-Path "C:\temp")) {
    New-Item -Path "C:\temp" -ItemType Directory | Out-Null
}


################# Main Menu #################

function Show-MainMenu {
    $form = New-Object Windows.Forms.Form
    $form.Text = "Self-Signed Certificate Manager"
    $form.Size = New-Object Drawing.Size(400, 330)
    $form.StartPosition = "CenterScreen"
    $form.TopMost = $true
    $form.FormBorderStyle = 'FixedDialog'
    $form.MaximizeBox = $false
    $form.MinimizeBox = $false

    # Embed Base64-encoded image directly
    $base64Image = ""

    try {
        # Convert the Base64 string back to a byte array
        $imageBytes = [Convert]::FromBase64String($base64Image)

        # Create a MemoryStream from the byte array
        $memoryStream = New-Object System.IO.MemoryStream
        $memoryStream.Write($imageBytes, 0, $imageBytes.Length)
        $memoryStream.Seek(0, [System.IO.SeekOrigin]::Begin)  # Reset the position to the beginning

        # Create an image from the MemoryStream
        $backgroundImage = [System.Drawing.Image]::FromStream($memoryStream)

        # Set the form's background image
        $form.BackgroundImage = $backgroundImage
        $form.BackgroundImageLayout = 'Stretch'  # or 'Zoom' if you prefer
    } catch {
        Write-Host "Error loading image: $_"
    }

    $label = New-Object Windows.Forms.Label
    $label.Text = "Select an option:"
    $label.BackColor = [System.Drawing.Color]::Transparent
    $label.ForeColor = [System.Drawing.ColorTranslator]::FromHtml("#18445c")
    $label.Location = New-Object Drawing.Point(17, 13)
    $label.Size = New-Object Drawing.Size(360, 30)
    $label.Font = New-Object Drawing.Font("Segoe UI", 14, [System.Drawing.FontStyle]::Bold)
    $form.Controls.Add($label)

    $buttons = @(
        @{ Text = "List Certificates"; Y = 60; Action = { $form.Hide(); Show-CertList; $form.Dispose() } },
        @{ Text = "Remove Certificate(s)"; Y = 110; Action = { $form.Hide(); Show-CertRemoval; $form.Dispose() } },
        @{ Text = "Self-Sign EXE"; Y = 160; Action = { $form.Hide(); SelfSignEXE; $form.Dispose() } },
        @{ Text = "Exit"; Y = 210; Action = { $form.Close(); $form.Dispose() } }
    )

    foreach ($btn in $buttons) {
        $button = New-Object Windows.Forms.Button
        $button.Text = $btn.Text
        $button.Size = New-Object Drawing.Size(280, 48)  # Increased width from 260 to 300
        $button.Location = New-Object Drawing.Point(55, $btn.Y)  # Adjusted position to keep it centered
        $button.Font = New-Object Drawing.Font("Segoe UI", 11, [System.Drawing.FontStyle]::Bold)

        # Flat and semi-transparent settings
        $button.FlatStyle = 'Flat'
        $button.FlatAppearance.BorderSize = 1
        $button.FlatAppearance.BorderColor = [System.Drawing.Color]::FromArgb(150, 255, 255, 255)
        $button.BackColor = [System.Drawing.Color]::FromArgb(120, 255, 255, 255)
        $button.ForeColor = [System.Drawing.Color]::FromArgb(10, 10, 10)

        # Optional: mouse hover lighter
        $button.FlatAppearance.MouseOverBackColor = [System.Drawing.Color]::FromArgb(180, 255, 255, 255)

        # Add custom Paint event for rounded corners and shadow
        $button.Add_Paint({
            param($sender, $e)

            $graphics = $e.Graphics
            $bounds = $sender.ClientRectangle
            $graphics.SmoothingMode = [System.Drawing.Drawing2D.SmoothingMode]::AntiAlias

            # Create rounded path
            $path = New-Object System.Drawing.Drawing2D.GraphicsPath
            $radius = 20
            $path.AddArc($bounds.X, $bounds.Y, $radius, $radius, 180, 11)
            $path.AddArc($bounds.Right - $radius, $bounds.Y, $radius, $radius, 270, 11)
            $path.AddArc($bounds.Right - $radius, $bounds.Bottom - $radius, $radius, $radius, 0, 11)
            $path.AddArc($bounds.X, $bounds.Bottom - $radius, $radius, $radius, 90, 11)
            $path.CloseAllFigures()

            # ➡️ Draw the shadow (dark offset)
            $shadowBrush = New-Object Drawing.SolidBrush([Drawing.Color]::FromArgb(80, 0, 0, 0))  # Dark shadow color with some transparency
            $shadowOffset = 3
            $graphics.FillPath($shadowBrush, $path)

            # ➡️ Draw the button itself
            $graphics.FillPath([Drawing.SolidBrush]$sender.BackColor, $path)

            # Set the region (rounded shape)
            $sender.Region = New-Object System.Drawing.Region($path)
        })

        $button.Add_Click($btn.Action)
        $form.Controls.Add($button)
    }

    $form.Add_Shown({ $form.Activate() })
    $form.ShowDialog()
}



# List Certificates with Search
$global:globalIndex = 0
function Show-CertList {
    $certsRaw = Get-ChildItem Cert:\CurrentUser\My | Select-Object Subject, Thumbprint, NotAfter
    $certs = @()
    $script:globalIndex = 0
    foreach ($cert in $certsRaw) {
        $script:globalIndex++
        $certs += [PSCustomObject]@{
            Index      = $script:globalIndex
            Subject    = $cert.Subject
            Thumbprint = $cert.Thumbprint
            NotAfter   = $cert.NotAfter
        }
    }
    
    $form = New-Object Windows.Forms.Form
    $form.Text = "Certificate List"
    $form.Size = New-Object Drawing.Size(650, 900)
    $form.StartPosition = "CenterScreen"
    $form.TopMost = $true

    # Search Panel
    $searchPanel = New-Object Windows.Forms.Panel
    $searchPanel.Dock = "Top"
    $searchPanel.Height = 65
    $searchPanel.BackColor = [System.Drawing.ColorTranslator]::FromHtml("#495861")
    
    $searchLabel = New-Object Windows.Forms.Label
    $searchLabel.Text = "Search:"
    $searchLabel.Location = New-Object Drawing.Point(8, 18)
    $searchLabel.Font = New-Object Drawing.Font("Segoe UI", 10)
    $searchLabel.ForeColor = [System.Drawing.Color]::white
    $searchLabel.AutoSize = $true
    $searchPanel.Controls.Add($searchLabel)
    

    $searchBox = New-Object Windows.Forms.TextBox
    $searchBox.Location = New-Object Drawing.Point(70, 12)
    $searchBox.Size = New-Object Drawing.Size(300, 20)
    $searchBox.Font = New-Object Drawing.Font("Segoe UI", 13)
    $searchBox.Add_TextChanged({
        Update-CertList
    })
    $searchPanel.Controls.Add($searchBox)
    
    $clearButton = New-Object Windows.Forms.Button
    $clearButton.Text = "Clear"
    $clearButton.font = New-Object Drawing.Font("Segoe UI", 11)
    $clearButton.ForeColor = [System.Drawing.Color]::white
    $clearButton.Location = New-Object Drawing.Point(380, 10)
    $clearButton.Size = New-Object Drawing.Size(85, 35)
    $clearButton.Add_Click({
        $searchBox.Text = ""
        Update-CertList
    })
    $searchPanel.Controls.Add($clearButton)
    
    $form.Controls.Add($searchPanel)

    # Certificate Display
    $textBox = New-Object Windows.Forms.RichTextBox
    $textBox.Multiline = $true
    $textBox.ReadOnly = $true
    $textBox.ScrollBars = "Both"
    $textBox.Dock = "Fill"
    $textBox.Font = New-Object Drawing.Font("Consolas", 11)
    $form.Controls.Add($textBox)

    # Create a container panel to properly position the textbox below the search panel
    $containerPanel = New-Object Windows.Forms.Panel
    $containerPanel.Dock = "Fill"
    $containerPanel.Padding = New-Object System.Windows.Forms.Padding(2, 71, 2, 2) # Top padding to account for search panel
    $containerPanel.Controls.Add($textBox)
    $form.Controls.Add($containerPanel)

    # Update certificate list function
    function Update-CertList {
    $searchTerm = $searchBox.Text.Trim()
        $filteredCerts = $certs

        if ($searchTerm) {
            $filteredCerts = $certs | Where-Object {
                $_.Subject -match [regex]::Escape($searchTerm) -or 
                $_.Thumbprint -match [regex]::Escape($searchTerm) -or
                $_.NotAfter.ToString() -match [regex]::Escape($searchTerm)
            }
        }

        $output = ""
        foreach ($cert in $filteredCerts) {
            $output += "[$($cert.Index)]`r`n"   # <<< use fixed number
            $output += "Subject: $($cert.Subject)`r`n"
            $output += "Thumbprint: $($cert.Thumbprint)`r`n"
            $output += "Valid Until: $($cert.NotAfter)`r`n`r`n"
        }

        if (-not $output) {
            $output = "No item found matching '$searchTerm'"
        }

        $textBox.Text = $output
        $textBox.SelectionStart = 0
        $textBox.ScrollToCaret()
    }

    # Initial update
    Update-CertList

    # Bottom panel for the button
    $buttonPanel = New-Object Windows.Forms.Panel
    $buttonPanel.Dock = "Bottom"
    $buttonPanel.Height = 60
    
    $btnClose = New-Object Windows.Forms.Button
    $btnClose.Text = "Back to Menu"
    $btnClose.Size = New-Object Drawing.Size(150, 40)
    $btnClose.Font = New-Object Drawing.Font("Segoe UI", 11)
    $btnClose.BackColor = [System.Drawing.ColorTranslator]::FromHtml("#495861")
    $btnClose.ForeColor = [System.Drawing.Color]::white

    # Position the button in the center of the panel
    $btnClose.Anchor = [System.Windows.Forms.AnchorStyles]::Bottom -bor [System.Windows.Forms.AnchorStyles]::Left -bor [System.Windows.Forms.AnchorStyles]::Right
    $buttonPanel.Controls.Add($btnClose)
    $form.Controls.Add($buttonPanel)

    $btnClose.Add_Click({
        $form.Close()
        $form.Dispose()
        Show-MainMenu
    })

    # Handle the form resize to keep button centered
    $form.Add_Resize({
        $btnClose.Left = ($buttonPanel.Width - $btnClose.Width) / 2
    })

    $form.Add_Shown({
        # Set initial button position after form is shown
        $btnClose.Left = ($buttonPanel.Width - $btnClose.Width) / 2
        $form.Activate()
    })
    
    $form.ShowDialog()
}

# Remove Certificate (updated to handle multiple certificates)
function Show-CertRemoval {
    $form = New-Object Windows.Forms.Form
    $form.Text = "Remove Certificate(s)"
    $form.Size = New-Object Drawing.Size(910, 707)
    $form.StartPosition = "CenterScreen"
    $form.TopMost = $true
    $form.FormBorderStyle = 'FixedSingle'  # allow minimize button, no maximize
    $form.MaximizeBox = $false
    $form.MinimizeBox = $true

    function Load-Certs {
        $listBox.Items.Clear()
        $certsRaw = Get-ChildItem Cert:\CurrentUser\My | Select-Object Subject, Thumbprint, NotAfter
        $global:certs = @()
        $global:globalIndex = 0
        foreach ($cert in $certsRaw) {
            $global:globalIndex++
            $global:certs += [PSCustomObject]@{
                Index      = $global:globalIndex
                Subject    = $cert.Subject
                Thumbprint = $cert.Thumbprint
                NotAfter   = $cert.NotAfter
            }
        }
        foreach ($cert in $global:certs) {
            $listBox.Items.Add("[$($cert.Index)] Subject: $($cert.Subject) | Thumbprint: $($cert.Thumbprint)")
        }
    }

    # ListBox for certificates
    $listBox = New-Object Windows.Forms.ListBox
    $listBox.Location = New-Object Drawing.Point(3, 10)
    $listBox.Size = New-Object Drawing.Size(900, 620)
    $listBox.SelectionMode = 'MultiExtended'
    $listBox.Font = New-Object Drawing.Font("Consolas", 11)
    $listBox.BackColor = [System.Drawing.ColorTranslator]::FromHtml("#495861")
    $listBox.ForeColor = [System.Drawing.ColorTranslator]::FromHtml("#FFFFFF")
    $form.Controls.Add($listBox)

    # Remove Button
    $btnRemove = New-Object Windows.Forms.Button
    $btnRemove.Text = "Remove Selected"
    $btnRemove.Size = New-Object Drawing.Size(225, 45)
    $btnRemove.Location = New-Object Drawing.Point(140, 625)
    $btnRemove.Font = New-Object Drawing.Font("Segoe UI", 12)
    $btnRemove.Add_Click({
        if ($listBox.SelectedItems.Count -eq 0) {
            [System.Windows.Forms.MessageBox]::Show("Please select at least one certificate to remove.","No Selection",[System.Windows.Forms.MessageBoxButtons]::OK,[System.Windows.Forms.MessageBoxIcon]::Warning)
            return
        }

        $confirm = [System.Windows.Forms.MessageBox]::Show("Are you sure you want to remove the selected certificate(s)?","Confirm Removal",[System.Windows.Forms.MessageBoxButtons]::YesNo,[System.Windows.Forms.MessageBoxIcon]::Question)
        if ($confirm -eq [System.Windows.Forms.DialogResult]::Yes) {
            foreach ($selectedItem in $listBox.SelectedItems) {
                if ($selectedItem -match 'Thumbprint: ([A-F0-9]+)') {
                    $thumbprint = $matches[1]
                    $certToRemove = Get-ChildItem Cert:\CurrentUser\My | Where-Object { $_.Thumbprint -eq $thumbprint }
                    if ($certToRemove) {
                        try {
                            $certToRemove | Remove-Item -ErrorAction Stop
                        }
                        catch {
                            [System.Windows.Forms.MessageBox]::Show("Failed to remove certificate with Thumbprint: $thumbprint. Error: $_","Error",[System.Windows.Forms.MessageBoxButtons]::OK,[System.Windows.Forms.MessageBoxIcon]::Error)
                        }
                    }
                }
            }
            [System.Windows.Forms.MessageBox]::Show("Selected certificate(s) removed successfully.","Success",[System.Windows.Forms.MessageBoxButtons]::OK,[System.Windows.Forms.MessageBoxIcon]::Information)
            Load-Certs   # <<< Reload the certificates list
        }
    })
    $form.Controls.Add($btnRemove)

    # Cancel Button
    $btnCancel = New-Object Windows.Forms.Button
    $btnCancel.Text = "Back to Menu"
    $btnCancel.Size = New-Object Drawing.Size(225, 45)
    $btnCancel.Location = New-Object Drawing.Point(540, 625)
    $btnCancel.Font = New-Object Drawing.Font("Segoe UI", 12)
    $btnCancel.Add_Click({
        $form.Close()
        $form.Dispose()
        Show-MainMenu
    })
    $form.Controls.Add($btnCancel)

    $form.Add_Shown({ 
        Load-Certs   # <<< Initial load
        $form.Activate()
    })
    $form.ShowDialog()
}

# Self-sign EXE
function SelfSignEXE {
    # Input form for cert name and password
    function Show-InputForm {
        $form = New-Object Windows.Forms.Form
        $form.Text = "Define a Name and a Password"
        $form.Size = New-Object Drawing.Size(530, 228)
        $form.StartPosition = "CenterScreen"
        $form.TopMost = $true
        $form.FormBorderStyle = 'FixedDialog'
        $form.MaximizeBox = $false
        $form.MinimizeBox = $false
        $form.BackColor = [System.Drawing.ColorTranslator]::FromHtml("#bfcdd6")
        $form.Opacity = 0.91

        $label1 = New-Object Windows.Forms.Label
        $label1.Text = "Certificate Name:"
        $label1.Font = New-Object Drawing.Font("Segoe UI", 9, [System.Drawing.FontStyle]::Bold)
        $label1.Location = New-Object Drawing.Point(21, 25)
        $label1.Size = New-Object Drawing.Size(150, 25)
        $form.Controls.Add($label1)
    
        $textBox1 = New-Object Windows.Forms.TextBox
        $textBox1.Location = New-Object Drawing.Point(182, 19)
        $textBox1.Width = 320
        $textBox1.Font = New-Object Drawing.Font("Lucida Console", 15)
        $form.Controls.Add($textBox1)

        $label2 = New-Object Windows.Forms.Label
        $label2.Text = "Certificate Password:"
        $label2.Font = New-Object Drawing.Font("Segoe UI", 9, [System.Drawing.FontStyle]::Bold)
        $label2.Location = New-Object Drawing.Point(21, 73)
        $label2.Size = New-Object Drawing.Size(161, 25)
        $form.Controls.Add($label2)

        $textBox2 = New-Object Windows.Forms.TextBox
        $textBox2.Location = New-Object Drawing.Point(182, 64)
        $textBox2.Width = 320
        $textBox2.UseSystemPasswordChar = $false
        $textBox2.Font = New-Object Drawing.Font("Lucida Console", 15)
        $form.Controls.Add($textBox2)

        # Create Button
        $okButton = New-Object Windows.Forms.Button
        $okButton.Text = "Select a file to sign"
        $okButton.Font = New-Object Drawing.Font("Segoe UI", 10)
        $okButton.Location = New-Object Drawing.Point( (([math]::Round(($form.ClientSize.Width - $okButton.Width) / 2))-48), 102 )
        $okButton.Size = New-Object Drawing.Size(200, 40)
        $okButton.DialogResult = [System.Windows.Forms.DialogResult]::OK
        $form.AcceptButton = $okButton
        $form.Controls.Add($okButton)

        # Back to Menu Button
        $backButton = New-Object Windows.Forms.Button
        $backButton.Text = "Back to Menu"
        $backButton.Font = New-Object Drawing.Font("Segoe UI", 10)
        $backButton.Location = New-Object Drawing.Point( (([math]::Round(($form.ClientSize.Width - $backButton.Width) / 2))-48), 147 )
        $backButton.Size = New-Object Drawing.Size(200, 30)
        $backButton.Add_Click({
            $form.DialogResult = [System.Windows.Forms.DialogResult]::Cancel
            $form.Close()
        })
        $form.Controls.Add($backButton)

        $form.Add_Shown({ $form.Activate() })

        $result = $form.ShowDialog()
        
        if ($result -eq [System.Windows.Forms.DialogResult]::OK) {
            return @{
                CertName = $textBox1.Text
                PasswordPlain = $textBox2.Text
                PasswordSecure = (ConvertTo-SecureString -String $textBox2.Text -AsPlainText -Force)
            }
        } else {
            return $null
        }
    }

    # Select software file
    function Select-SoftwareFile {
        $openFileDialog = New-Object System.Windows.Forms.OpenFileDialog
        $openFileDialog.Title = "Select your exe. File to Sign"
        $openFileDialog.Filter = "Executable Files (*.exe)|*.exe"
        $openFileDialog.InitialDirectory = "C:\temp"
        $openFileDialog.Multiselect = $false
        if ($openFileDialog.ShowDialog() -eq [System.Windows.Forms.DialogResult]::OK) {
            return $openFileDialog.FileName
        } else {
            return $null
        }
    }

    # Step 1: Get user input
    $userInput = Show-InputForm
    if (-not $userInput) {
        Show-MainMenu
        return
    }
    $certName = $userInput.CertName
    $passwordSecure = $userInput.PasswordSecure

    # Step 2: Get software file
    $softwarePath = Select-SoftwareFile
    if (-not $softwarePath) {
        $msgBox = New-Object System.Windows.Forms.Form
        $msgBox.TopMost = $true
        $msgBox.FormBorderStyle = 'FixedDialog'
        $msgBox.MaximizeBox = $false
        $msgBox.MinimizeBox = $false
        $msgBox.StartPosition = 'CenterScreen'
        $msgBox.Size = New-Object Drawing.Size(255, 140)
        $msgBox.Text = "Canceled"
        $msgBox.Opacity = 0.7
        
        $label = New-Object System.Windows.Forms.Label
        $label.Text = "No file Selected.$([Environment]::NewLine)No Certificate Created."
        $label.Font = New-Object Drawing.Font("Segoe UI", 9, [System.Drawing.FontStyle]::Bold)
        $label.Location = New-Object Drawing.Point(11, 16)
        $label.Size = New-Object Drawing.Size(370, 50)
        $msgBox.Controls.Add($label)

        #$label.AutoSize = $true

        
        $button = New-Object System.Windows.Forms.Button
        $button.Text = "OK"
        $button.Location = New-Object Drawing.Point(84, 70)
        $button.Size = New-Object Drawing.Size(85, 23)
        $button.Add_Click({ $msgBox.Close() })
        $msgBox.Controls.Add($button)
        
        $msgBox.Add_Shown({ $msgBox.Activate() })
        $msgBox.ShowDialog()
        
        Show-MainMenu
        return
    }

    # Step 3: Create and export certificate
    $cert = New-SelfSignedCertificate -Type CodeSigning -Subject "CN=$certName" -CertStoreLocation Cert:\CurrentUser\My
    $cerPath = "C:\temp\$certName.cer"

    Export-Certificate -Cert "Cert:\CurrentUser\My\$($cert.Thumbprint)" -FilePath $cerPath | Out-Null

    certutil -addstore "Root" $cerPath | Out-Null

    # Step 4: Sign the file
    Set-AuthenticodeSignature -FilePath $softwarePath -Certificate $cert -TimestampServer "http://timestamp.sectigo.com" | Out-Null

    # Step 5: Cleanup
    Remove-Item $cerPath -Force

    # Step 6: Success Message
    $successForm = New-Object Windows.Forms.Form
    $successForm.Text = "DONE!"
    $successForm.Size = New-Object Drawing.Size(460, 155)
    $successForm.StartPosition = "CenterScreen"
    $successForm.TopMost = $true
    $successForm.FormBorderStyle = 'Fixed3D'
    $successForm.MaximizeBox = $false
    $successForm.MinimizeBox = $false

    $successLabel = New-Object Windows.Forms.Label
    $successLabel.Text = "The file was successfully signed!"
    $successLabel.AutoSize = $true
    $successLabel.Location = New-Object Drawing.Point(40, 30)
    $successLabel.Font = New-Object Drawing.Font("Lucida Console", 11)
    $successForm.Controls.Add($successLabel)


    $okBtn = New-Object Windows.Forms.Button
    $okBtn.Text = "OK"
    $okBtn.Size = New-Object Drawing.Size(130, 30)
    $okBtn.Location = New-Object Drawing.Point(165, 75)
    $okBtn.Add_Click({ $successForm.Close(); $successForm.Dispose(); Show-MainMenu })
    $successForm.Controls.Add($okBtn)

    $successForm.Add_Shown({ $successForm.Activate() })
    $null = $successForm.ShowDialog()
}

# Start
Show-MainMenu